import React from "react";
import './Home.css';

const Home = () => {
    return (
        <div className="container" style={{background:'rgb(128,128,128,0.5)'}}>
            <h2>Welcome to the Crewmates Homepage! </h2> 
            <p>⭐️ Click on the "Crewmate Gallery" button to see all the crewmates. </p> 
            <p>⭐️ Click on the "Create Crewmate" button to create a new crewmate!</p>
            <p>⭐️ You can also edit/ delete existing crewmates using the card's upper right menu. </p>
        </div>

    );
};

export default Home;
